int cmp(const void *a,const void *b){
	struct suanshi *aa=(struct suanshi *)a;
	struct suanshi *bb=(struct suanshi *)b;
	if((aa->x)<(bb->x))return 1;
	if((aa->x)>(bb->x))return -1;
	else return (aa->no)-(bb->no);
}
