	{
		if(num<0)numz=0-num;
		else numz=num;
		for(i=0;;i++)
		{
			a[i]=numz%10;
			numz/=10;
			if(numz<1)break;
		}
		for(j=0;j<i+1;j++)
		{
			rvs*=10;
			rvs+=a[j];	
		}
		if(num<0)rvs*=(-1);

	}
	return rvs;
}
