double m(double a,double b,double c,double d,double e)
{
	double pi,s,sq;
	s=(a+b+c+d)/2;
	pi=3.1415926;
	sq=sqrt((s-a)*(s-b)*(s-c)*(s-d)-a*b*c*d*cos(pi*e/360)*cos(pi*e/360));
	return(sq);
}

