char substr(char s[], int start, int end)
{
while ((end>start)&&(s[start]==s[end]))
{ start++; end--;}
if(end>start)
return 0; 
else return 1; 
}

osubstr(char s[], int start, int end)
{
while(start<=end) putchar(s[start++]);
putchar('\n');
}
